import React from 'react';
import Header from '../../components/Header/Header';
import Footer from '../../components/Footer/Footer';

export default function Home() {
  return (

    <div>
      <Header />
      <div>
        {"This is Home Page"}
      </div>
      <br />
      <div className='body'>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit, 
           labore et dolore magna aliqua. Sapien et ligula ullamcorper malesuada proin libero nunc. Consectetur a erat nam at. Malesuada fames ac turpis egestas integer eget aliquet nibh. Velit euismod in pellentesque massa. Mollis nunc sed id semper risus in hendrerit gravida. Donec et odio pellentesque diam volutpat. Mi sit amet mauris commodo quis. Quis enim lobortis scelerisque fermentum dui faucibus. Morbi non arcu risus quis varius quam. Aliquet nec ullamcorper sit amet risus nullam eget. 
           Mi eget mauris pharetra et ultrices neque ornare. Varius sit amet mattis vulputate enim nulla aliquet porttitor lacus. Platea dictumst quisque sagittis purus. Lobortis feugiat vivamus at augue eget arcu dictum varius duis. In dictum non consectetur a erat nam at lectus. Nullam ac tortor vitae purus faucibus ornare suspendisse. Ut venenatis tellus in metus vulputate eu scelerisque felis imperdiet. Egestas fringilla phasellus faucibus scelerisque eleifend. 
           Neque convallis a cras semper auctor neque vitae.
        </p>
      </div>
      <Footer />
    </div>
  )
}
